import React, { useState } from "react";
import Modal from "react-modal";
import Register from "../../pages/register";
import Login from "../../pages/login";
import { Link } from "react-router-dom";

import { Nav, NavLink, NavMenu, NavBtn, NavBtnLink } from "./NavbarElement";

Modal.setAppElement("#root");

function Navbar() {
  const [] = useState("login");

  const [isRegisterModalOpen, setRegisterModalOpen] = useState(false);
  const [isLoginModalOpen, setLoginModalOpen] = useState(false);

  const handleRegisterClick = () => {
    setRegisterModalOpen(true);
  };
  const handleLoginClick = () => {
    setLoginModalOpen(true);
  };

  return (
    <div className="Index">
      <Nav>
        <Link to="/home">
          <img
            src="./images/sonnenspiele-logo.webp"
            alt="Logo"
            style={{ width: "auto", height: "50px", margin: "10px" }}
          />
        </Link>
        <NavMenu>
          <NavLink to="/products" activeStyle>
            Alle virtuelle Automatenspele!
          </NavLink>
          <NavLink onClick={handleLoginClick} activeStyle>
            Anmelden
          </NavLink>
        </NavMenu>
        <NavBtn>
          <NavBtn>
            <NavBtnLink onClick={handleRegisterClick}>Registrieren</NavBtnLink>
          </NavBtn>

          <Modal
            isOpen={isRegisterModalOpen}
            onRequestClose={() => setRegisterModalOpen(false)}
            style={{
              content: {
                width: "40%",
                height: "90%",
                top: "50%",
                left: "50%",
                transform: "translate(-50%, -50%)",
                borderRadius: "8px",
              },
            }}
          >
            <Register />
          </Modal>
        </NavBtn>
      </Nav>
    </div>
  );
}

export default Navbar;
